import React from "react";
import "./App.css"; // Link to your CSS file

function App() {
  return (
    <div className="app">
      <header className="app-header">
        <h1>Welcome to Music Information Management System</h1>
      </header>
      <main className="app-main">
        <button className="button">Search By Artist</button>
        <button className="button">Search by Song</button>
        <button className="button">Search by Lyrics</button>
      </main>
      <footer className="app-footer">
        <p>&copy; 2024 Music Management System</p>
      </footer>
    </div>
  );

}

export default App;
